  }


  return (
    <div className="container">        
        <div className='row'>    
            <div className="col l3 m3 s12"></div>
            <div className="col l6 m6 s12 z-depth-5 card-panel">                
                  <h5 className="center">Log In</h5>
                  <div className="input-field col s12">                
                    <input id="UserEmail" type="email" className="validate" />
                    <label htmlFor="UserEmail">Enter email</label>
                  </div>
                  <div className="input-field col s12">
                    <input id="UserPassword" type="password" className="validate" />
                    <label htmlFor="UserPassword">Enter password</label>
                  </div>                       	  
                  <div className="input-field col s12">
                      <a href="#!" 
                      onClick={onSubmit}
                      className='waves-effect waves-light btn'>Log In</a>  			
                  </div>
                  <div className="input-field col s12">
                      <a href="#registeruser-event-modal"
                              className='waves-effect waves-light modal-trigger tooltipped'                                                          
                              data-tooltip="Register a new user"
                              onClick={onRegister}
                              >Register                           
                      </a>                       
                  </div>                 
            </div>
            <div className="col l3 m3 s12"></div>            
        </div>
    </div>
  )
}

export default Login
